import React from "react";
import { useQuery } from "react-query";

import { getUser } from "../clients/home";
import useAuthStore from "../stores/authStore";

function Profile() {
  const token = useAuthStore((state) => state.accessToken);
  const { isLoading, error, data } = useQuery("user", () => getUser(token));

  if (isLoading) {
    return <div>Loading...</div>;
  }

  if (error) {
    let errorObj = error as { message: string };
    return <div>An error has occurred: {errorObj.message}</div>;
  }

  return (
    <div>
      <p>{JSON.stringify(data)}</p>
    </div>
  );
}

export default Profile;
